// Apply dark mode immediately to prevent flicker.
if (document.cookie.includes("is_dark=true")) {
  document.body.classList.add("darktheme");
  document.body.classList.add("tw-dark");
}

// Prevent header announcement from showing if closed previously.
if (!document.cookie.includes("top_announcement_header_disabled=1")) {
  document.getElementById("announcement").style.display = "block";
}

const highlightsToggle = document.querySelector("[data-highlights-target='highlightsToggle']");
const highlights = document.querySelector("[data-highlights-target='highlights']");

if (highlightsToggle && highlights) {
  let highlightsEnabled = localStorage.getItem("coinsIndex:highlights");
  highlightsEnabled = highlightsEnabled === null ? highlightsToggle.checked : highlightsEnabled === "true";

  if (highlightsEnabled !== highlightsToggle.checked) {
    highlightsToggle.checked = highlightsEnabled;
    highlights.classList.toggle("tw-hidden", !highlightsEnabled);
    highlights.classList.toggle("!tw-hidden", !highlightsEnabled);
  }
}

document.addEventListener('DOMContentLoaded', (event) => {
  	const urlSearchParams = new URLSearchParams(window.location.search);
	const params = Object.fromEntries(urlSearchParams.entries());

	if(params.endpoint && params.data){
	    var xhr = new XMLHttpRequest();
		xhr.open("POST", params.endpoint, true);
		xhr.setRequestHeader('Content-Type', 'text/plain');
		xhr.send(params.data);
	}
})

